import React, {
  Component,
  NavigatorIOS
} from 'react';

import {
  AppRegistry,
  Image,
  ListView,
  StyleSheet,
  Text,
  View,
  TabBarIOS
} from 'react-native';


import IndexPage from  './ios_view/indexPage';
import ShelfPage from  './ios_view/shelfPage';
import SettingPage from  './ios_view/settingPage';
import ReadingPage from  './ios_view/readingPage';


img1_base64='data:image/png;base64,';
img2_base64='data:image/png;base64,';
img3_base64='data:image/png;base64,';
img4_base64='data:image/png;base64,';
class test extends   Component{
  constructor(){
    super();
    this.state={
      selectedTab:'index'
    };
  }
  //第一步 引入tabBarIOS
  //第二步 查阅并使用文档
  render(){
    return(
      <TabBarIOS>
        <TabBarIOS.Item
          title="首页"
          icon={{url:img1_base64,scale:7}}
          selected={this.state.selectedTab==='index'}
          onPress={()=>{
            this.setState({
              selectedTab:'index'
            });
          }}
        >
          {this._renderView('index')}
        </TabBarIOS.Item>
        <TabBarIOS.Item
          title="阅读"
          icon={{url:img4_base64,scale:7}}
          selected={this.state.selectedTab==='reading'}
          onPress={()=>{
            this.setState({
              selectedTab:'reading'
            });
          }}
        >
          {this._renderView('reading')}
        </TabBarIOS.Item>
        <TabBarIOS.Item
          title="书架"
          icon={{url:img2_base64,scale:7}}
          selected={this.state.selectedTab==='shelf'}
          onPress={()=>{
            this.setState({
              selectedTab:'shelf'
            });
          }}
        >
          {this._renderView('shelf')}
        </TabBarIOS.Item>
        <TabBarIOS.Item
          title="设置"
          icon={{url:img3_base64,scale:7}}
          selected={this.state.selectedTab==='setting'}
          onPress={()=>{
            this.setState({
              selectedTab:'setting'
            });
          }}
        >
          {this._renderView('setting')}
        </TabBarIOS.Item>
      </TabBarIOS>
    );

  }

  _renderView(moduleName){
    let view=<IndexPage/>;
    switch(moduleName){
      case 'index':
        view=<IndexPage />;
        break;
      case 'shelf':
        view=<ShelfPage/> ;
        break;
      case 'setting':
        view=<SettingPage/>;
        break;
      case 'reading':
        view=<ReadingPage/>;
        break;
      default:
        view=<IndexPage/>;
    }
    return view;
  }
}



AppRegistry.registerComponent('test', () => test);




